import React from "react";

const Campaign = () => {
  return (
    <div class="card mb-3">
      <div class="row no-gutters">
        <div class="col-md-4">
          <img src="..." class="card-img" alt="..." />
        </div>
        <div class="col-md-8">
          <div class="card-body">
            <h5 class="card-title">Auto Chess</h5>
            <p class="card-text">
              <small class="text-muted">US</small>
            </p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Campaign;
